export function request(type, page, data) {
  return {
    type,
    payload: { page, data },
  };
}
export function success(page, action, data) {
  return {
    type: `@${page}/${action}_SUCCESS`,
    payload: { data },
  };
}
export function failure(page, action, data) {
  return {
    type: `@${page}/${action}_FAILURE`,
    payload: { data },
  };
}
